import React from 'react';
import Button from "react-bootstrap/Button";
import {Form} from "react-bootstrap";

const Auth = (props) => {
    return (
        <div className={"registration_page"}>
            <Button className={"button_reg_auth"} onClick={props.toRegistration}>Registration</Button>

            <Form.Group className="mb-3" controlId="ID_control">
                <Form.Label>ID</Form.Label>
                <Form.Control type="text" placeholder="@000000" />
            </Form.Group>

            <Form.Group className="mb-3" controlId="text_control">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
            </Form.Group>

            <Button onClick={props.authorisation}>Go</Button>
        </div>
    );
};

export default Auth;
